import { useState } from "react"

// interface IProps{
    
//     id:string,
//     name:string,
//     team:string

// }[]


const ProjectList=()=>{
  const [dataDUMY,setdataDUMY]=useState([
    {id:"444",name:"matan",team:"macabi tel aviv"},
    {id:"123",name:"hadad",team:"hapoel jeruzlem"}
  ])
 
return (
    <ul>
    <div>{dataDUMY.map((item:any)=>{
    return <li key={item.id}>{item.name},{item.team}
</li>
    })}</div>
    </ul>
)
}

export default ProjectList
